import React, { useState } from 'react';
import { TextField, Button, Container, Typography, Box, Card, Fade } from '@mui/material';
import { styled } from '@mui/material/styles';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import { motion } from 'framer-motion';

// Custom styled components
const GradientCard = styled(Card)(({ theme }) => ({
  background: 'linear-gradient(135deg, #1e3c72 0%, #2a5298 100%)',
  padding: theme.spacing(4),
  borderRadius: '16px',
  boxShadow: '0 10px 30px rgba(0, 0, 0, 0.2)',
  color: '#fff',
  maxWidth: 400,
  margin: '0 auto',
}));

const ModernButton = styled(Button)(({ theme }) => ({
  borderRadius: '25px',
  padding: theme.spacing(1, 4),
  textTransform: 'none',
  fontWeight: 600,
  fontSize: '1rem',
  background: '#fff',
  color: '#1e3c72',
  '&:hover': {
    background: '#e0e0e0',
  },
}));

const SwitchButton = styled(Button)(({ theme }) => ({
  color: '#fff',
  textTransform: 'none',
  fontSize: '0.9rem',
  '&:hover': {
    color: '#ddd',
  },
}));

function Login() {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [isRegister, setIsRegister] = useState(false);
  const navigate = useNavigate();

  const handleSubmit = async () => {
    const endpoint = isRegister ? '/register' : '/login';
    try {
      const response = await axios.post(`http://localhost:8080/api/auth${endpoint}`, {
        username,
        password,
      });
      console.log('Response:', response.data);
      if (response.status === 200) {
        if (!isRegister) {
          localStorage.setItem('userId', response.data.userId);
          navigate('/');
        } else {
          alert('Registration successful! Please login.');
          setIsRegister(false);
        }
      }
    } catch (error) {
      console.error('Error:', error.response?.data);
      alert(error.response?.data || 'An error occurred during ' + (isRegister ? 'registration' : 'login'));
    }
  };

  return (
    <Container sx={{ height: '100vh', display: 'flex', alignItems: 'center', background: '#f5f7fa' }}>
      <Fade in timeout={1000}>
        <GradientCard elevation={6}>
          <motion.div initial={{ opacity: 0, y: -20 }} animate={{ opacity: 1, y: 0 }} transition={{ duration: 0.5 }}>
            <Typography variant="h3" align="center" gutterBottom sx={{ fontWeight: 700, letterSpacing: '-1px' }}>
              {isRegister ? 'Join Us' : 'Welcome Back'}
            </Typography>
            <Typography variant="body1" align="center" sx={{ mb: 3, opacity: 0.9 }}>
              {isRegister ? 'Create your account' : 'Sign in to your todo app'}
            </Typography>
            <TextField
              label="Username"
              fullWidth
              variant="outlined"
              value={username}
              onChange={(e) => setUsername(e.target.value)}
              sx={{
                mb: 2,
                background: 'rgba(255, 255, 255, 0.1)',
                borderRadius: '8px',
                input: { color: '#fff' },
                '& .MuiOutlinedInput-root': {
                  '& fieldset': { borderColor: 'rgba(255, 255, 255, 0.3)' },
                  '&:hover fieldset': { borderColor: '#fff' },
                },
                '& .MuiInputLabel-root': { color: 'rgba(255, 255, 255, 0.7)' },
              }}
            />
            <TextField
              label="Password"
              type="password"
              fullWidth
              variant="outlined"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              sx={{
                mb: 3,
                background: 'rgba(255, 255, 255, 0.1)',
                borderRadius: '8px',
                input: { color: '#fff' },
                '& .MuiOutlinedInput-root': {
                  '& fieldset': { borderColor: 'rgba(255, 255, 255, 0.3)' },
                  '&:hover fieldset': { borderColor: '#fff' },
                },
                '& .MuiInputLabel-root': { color: 'rgba(255, 255, 255, 0.7)' },
              }}
            />
            <ModernButton variant="contained" fullWidth onClick={handleSubmit}>
              {isRegister ? 'Register' : 'Login'}
            </ModernButton>
            <SwitchButton fullWidth onClick={() => setIsRegister(!isRegister)} sx={{ mt: 2 }}>
              {isRegister ? 'Already have an account? Login' : 'Need an account? Register'}
            </SwitchButton>
          </motion.div>
        </GradientCard>
      </Fade>
    </Container>
  );
}

export default Login;
